import  './HeaderStyle.css';
import React from "react" ;
function Header(){
    return(
        <>
        <section>
            <ul>
                <li>
                    Home
                </li>
                <li>
                    Contact Us
                </li>
            </ul>
        </section>
        </>
    )
}
export default Header;//default exporting
